Firstly, let's calculate terms in parentheses: -75*-8, 17+42, 48+38, and 19-84. The intermediate results are:
- -75*-8 = 600 which modulo 100 is 0;
- 17+42 = 59;
- 48+38 = 86;
- 19-84 = -65 which modulo -100 is -65.

Now, our expression looks like this: ((0*59)-(86*-65)).

Next, let's multiply: 
- 0*59 = 0; 
- 86*-65 = -5590 which modulo -100 is -90.

So, ((0*59)-(86*-65)) turns into (0--90), which is 90.
